main(int iType)
{
  dyn_errClass err;

  int          i, iReturnValue = 1, iDpCount = 10;
  dyn_int      diType = makeDynInt();
  dyn_string   dsDps;

  dsDps[1] = $dp+&quot;.CPU.SF&quot; + &quot;:_alert_hdl.._ack&quot;;
  dsDps[2] = $dp+&quot;.CPU.INTF&quot; + &quot;:_alert_hdl.._ack&quot;;
  dsDps[3] = $dp+&quot;.CPU.EXTF&quot; + &quot;:_alert_hdl.._ack&quot;;
  dsDps[4] = $dp+&quot;.CPU.BUS1F&quot; + &quot;:_alert_hdl.._ack&quot;;
  dsDps[5] = $dp+&quot;.CPU.BUS2F&quot; + &quot;:_alert_hdl.._ack&quot;;
  dsDps[6] = $dp+&quot;.CPU.STOP&quot; + &quot;:_alert_hdl.._ack&quot;;
  dsDps[7] = $dp+&quot;.CPU.BAF&quot; + &quot;:_alert_hdl.._ack&quot;;
  dsDps[8] = $dp+&quot;.CPU.REDF&quot; + &quot;:_alert_hdl.._ack&quot;;
  dsDps[9] = $dp+&quot;.CPU.IFM1F&quot; + &quot;:_alert_hdl.._ack&quot;;
  dsDps[10] = $dp+&quot;.CPU.IFM2F&quot; + &quot;:_alert_hdl.._ack&quot;;

  if ( isFunctionDefined(&quot;isAckable&quot;) )
  {
    isAckable( iType, dsDps, iReturnValue );
    if ( iReturnValue == 0 || dynlen (dsDps ) &lt; 1 ) return;
  }

  for ( i = 1; i &lt;= dynlen(dsDps); i++ )
    diType[i] = iType;

  dpSetWait( dsDps, diType );

  err = getLastError();
  if ( dynlen(err) &gt; 0 )
    DebugN(err);
}
